📜COPARTICIPACIÓN: "EL FALLO DE LA CORTE AFECTA A LA PROVINCIA Y AL INTERIOR DEL PAÍS"

🖋La Corte Suprema de Justicia por unanimidad falló a favor de la medida cautelar interpuesta por la Ciudad Autónoma de Buenos Aires con respecto a la asignación de fondos coparticipables. Aumentó ese porcentaje a 2,95.

